import React from 'react'

const SuccesfullNotification = ({ message }) => {
  
  if (message === null) {
    return null
  }
  else if (true){

    console.log('message  ' , message)
  return (
    <div className="succesfull">
      {message}
    </div>
  )
} else {

  return (
    <div className="succesfull">
      {message}
    </div>
  )
}
}




export default SuccesfullNotification
